import Clock from 'react-live-clock';

function TimeBox() {
    const { timeZone } = Intl.DateTimeFormat().resolvedOptions();

    return (
        <Clock class="text-lg text-white" format={'MMMM Do HH:mm'} blinking={true} timezone={timeZone} />
    )
}

export default TimeBox;
